DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_alumnos` ()   BEGIN
    DECLARE i INT DEFAULT 1;
    
    WHILE i <= 100000 DO
        VALUES (
            FLOOR(100000000 + RAND() * 899999999), -- Cedula aleatoria de 10 dígitos
            CONCAT('Nombre', i), -- Nombre genérico
            CONCAT('Apellido', i), -- Apellido genérico
            CONCAT('Dirección', i), -- Dirección genérica
            FLOOR(100000000 + RAND() * 899999999), -- Teléfono aleatorio de 9 dígitos
            'Ciudad de Ejemplo', -- Ciudad genérica
            'País de Ejemplo', -- País genérico
            CONCAT('email', i, '@example.com'), -- Email genérico
            DATE_SUB(CURDATE(), INTERVAL FLOOR(6570 + RAND() * 10950) DAY), -- Fecha de nacimiento aleatoria entre 18 y 30 años atrás
            'Carrera de Ejemplo' -- Carrera genérica
        );
        
        SET i = i + 1;
    END WHILE;
END$$

DELIMITER ;

